import React,  {useEffect, useState} from 'react';
import { useParams } from 'react-router';
// import { UserContext } from "../user-context";

function UserPosts(){
    const {id} = useParams();
    const {posts, setPosts}=useContext([]);
  useEffect(() => {
   
    fetch(`http://127.0.0.1:8000/posts/${id}`, {
      credentials: "include",
    }).then((res) => {
      res.json().then((posts) => {
      setPosts(posts);
      console.log(posts);
      });
    });
  }, []);
    return <div>Blog</div>
}

export default UserPosts;
